import React from 'react';
import {View} from 'react-native'
import { Entypo } from '@expo/vector-icons';

function Bottom(props) {
    return (
        <View style={{
            height: 80 ,
            backgroundColor:'white',
            flexDirection:'row'
        }}>
        <View style={{
            flex:3,
            backgroundColor:'green',
            alignItems:'center',
            marginTop:10,
        }}>
        <Entypo name="location" size={40} color='#1C2348' />

        </View>
        <View style={{
            flex:3,
            backgroundColor:'red',
        }}>

        </View>
        <View style={{
            flex:3,
            backgroundColor:'green',
        }}>

        </View>
        
        
        </View>
        
    );
}

export default Bottom;
